import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Axios from 'axios';

const appid = require("appid");
class WishlistCard extends Component {
    state = {
        games: [],
        gameInfo: {
            name: "",
            bestPrice: "",
            seller: "",
            page: ""
        }
    }

    componentDidMount(){
        Axios.get()
        .then(response => {
            this.setState({
                games: response.data
            })
        })
        Axios.post()
    }
    render() {
        return (
            this.state.games.map ((games, index) => {
                <div className="Card">
                <h3>Name of Game</h3>
                <h5>Name of Company</h5>
                 Best Price
                <Link>Game Page</Link>
            </div>
            })
            
        );
    }
}

export default WishlistCard;
